import React from 'react';

const Banner = ({ ultimoVideo }) => {
  return (
    <div className="banner-elementos">
      <div className="banner-elementos-texto">
        <h2 className="banner-titulo-principal">{ultimoVideo.categoria}</h2>
        <h3 className="banner-titulo-secundario">{ultimoVideo.titulo}</h3>
        <p className="banner-descripcion">{ultimoVideo.descripcion}</p>
      </div>
      <a href={ultimoVideo.link}>
        <img src={ultimoVideo.imagen} alt="{ultimoVideo.titulo}" />
      </a>
    </div>
  );
};

export default Banner;
